         */
        static associate(models) {
            // define association here
            //   Province.hasMany(models.Post, { foreignKey: 'userId', as: 'user' })
        }
    }
    Province.init({
        code: DataTypes.STRING,
        value: DataTypes.STRING,
    }, {
        sequelize,
        modelName: 'Province',
    });
    return Province;
};

